import java.util.Scanner;/** * @param * @author Administrator * @date 2021/3/31 0031 16:49 * @throws Exception */public class l1016 {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        int n =Integer.parseInt(sc.nextLine());        String[] message = new String[n];        for(int i=0;i< message.length;i++){            message[i]=sc.nextLine();        }        sc.close();        int[] pow =new int[] {7,9,10,5,8,4,2,1,6,3,7,9,10,5,8,4,2};        char[] M = new char[] {'1','0','X','9','8','7','6','5','4','3','2'};        boolean flag = true;        for(int i=0;i<message.length;i++){            int sum=0;            for(int j=0;j<17;j++){                if(message[i].charAt(j)>='0'&&message[i].charAt(j)<='9'){                    sum+=(message[i].charAt(j)-'0')*pow[j];                }            }            char right=M[sum%11];            if(message[i].charAt(17)!=right){                System.out.println(message[i].toString());                flag=false;            }        }        if(flag){            System.out.println("All passed");        }    }}